syntax = "proto2";

package com.fissy.dialer.logging;
option java_package = "com.fissy.dialer.logging";
option java_multiple_files = true;
option optimize_for = LITE_RUNTIME;




message VideoTech {
  enum Type {
    NONE = 0;

    IMS_VIDEO_TECH = 1;
    LIGHTBRINGER_VIDEO_TECH = 2;
    RCS_VIDEO_SHARE = 3;
  }
}